import actionPromise from "./ActionPromise";
import store from "./Store";
import { connect } from "react-redux";
import { useLocation } from "react-router-dom";
import AdminOrderInfo from "./AdminOrderInfo";
function AdminOrders() {
  let gql = (url, query, variables) =>
    fetch(url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Bearer " + localStorage.authToken,
        Accept: "application/json",
      },
      body: JSON.stringify({ query, variables }),
    }).then((res) => console.log(res.json()));
  store.dispatch(
    actionPromise(
      "orders",
      gql(
        "http://shop-roles.node.ed.asmer.org.ua/graphql",
        `query orders($q: String) {
            OrderFind(query: $q) {
                orderGoods{good {
                _id
                createdAt
                name
                description
                price
                }},owner {
                _id
                createdAt
                login
                nick
                }
                total
                _id
            }
            }`,
        { q: JSON.stringify([{}]) }
      )
    )
  );
  const AdminOrdersInfo = connect((state) => ({
    orders: state.promise.orders.payload,
  }))(AdminOrderInfo);
    return <AdminOrdersInfo />;
}
export default AdminOrders;
